class Solution:
	def repeatedNumber(self, A):
		import math 

		N = len(A) - 1
		print(N)
		sq = math.sqrt(N)
		left = int(math.floor(sq))
		fr = [0 for i in range(left + 1)]
		for i in A:
			point = (i - 1) / sq
			print(point)
			number = int(math.floor(point))
			fr[number] += 1
		print(fr)
		j = 0
		max = 0 
		for idx, i in enumerate(fr):
			if i > max:
				max = i
				j = idx
		ht = {}
		for i in A:
			if sq * j <= i <= sq * (j + 1) or sq * (len(fr) - 1) <= i <= sq * len(fr): 
				if ht.get(i, None) != None:
					return i
				else:
					ht[i] = True


		return -1

